import React, { Component } from 'react';
import './App.css';
import './bootstrap.css';
import './nav.css';
import "@fortawesome/fontawesome-free/css/all.min.css";
import "bootstrap-css-only/css/bootstrap.min.css";
import "mdbreact/dist/css/mdb.css";
import { MDBNavbar, MDBNavbarBrand, NavbarNav, MDBNavItem, MDBNavLink, MDBNavbarToggler, MDBCollapse, MDBContainer }
from 'mdbreact';

class App extends Component {
  showSettings (event) {
    event.preventDefault();
  }
  render() {
    return (
      <div className="">
        <header className="">
          <nav id="navtop" className="navbar navbar-default sticky-top">
            <div className="container-fluid">
              <div className="col-md-6">
                <h1><strong>Label</strong></h1>
              </div>
                  <a className="menu-item" href="#home">Home</a>
                  <a className="menu-item" href="#search">Search</a>
                  <a className="menu-item" href="#about">About Us</a>
                  <a className="menu-item" href="#login">Log In</a>
                  <a className="menu-item" href="#create">Create Account</a>
              <button className="navbar-toggler toggler-example" type="button" data-toggle="collapse" data-target="#navbarSupportedContent1"
                aria-controls="navbarSupportedContent1" aria-expanded="false" aria-label="Toggle navigation"><span className="dark-blue-text"><i
                    className="fas fa-bars fa-1x"></i></span></button>

              <div className="collapse navbar-collapse" id="navbarSupportedContent1">

                <ul className="navbar-nav mr-auto">
                  <li className="nav-item active">
                    <a className="nav-link" href="#home">Home<span className="sr-only">(current)</span></a>
                  </li>
                  <li className="nav-item">
                    <a className="nav-link" href="#analyze">Analyze</a>
                  </li>
                  <li className="nav-item">
                    <a className="nav-link" href="#about">About Us</a>
                  </li>
                </ul>

              </div>
            </div>
          </nav>
        </header>
        <section>
        </section>
      </div>
    );
  }
}

class hamburgerMenuPage extends Component {
state = {
  collapseID: ''
}

toggleCollapse = collapseID => () => {
  this.setState(prevState => ({ collapseID: (prevState.collapseID !== collapseID ? collapseID : '') }));
}

render() {
  return (
    <MDBContainer>
      <MDBNavbar color="light-blue lighten-4" style={{ marginTop: '20px' }} light>
        <MDBContainer>
          <MDBNavbarBrand>
            Navbar
          </MDBNavbarBrand>
          <MDBNavbarToggler onClick={this.toggleCollapse('navbarCollapse1')} />
          <MDBCollapse id="navbarCollapse1" isOpen={this.state.collapseID} navbar>
            <NavbarNav left>
              <MDBNavItem active>
                <MDBNavLink to="#!">Home</MDBNavLink>
              </MDBNavItem>
              <MDBNavItem>
                <MDBNavLink to="#!">Link</MDBNavLink>
              </MDBNavItem>
              <MDBNavItem>
                <MDBNavLink to="#!">Profile</MDBNavLink>
              </MDBNavItem>
            </NavbarNav>
          </MDBCollapse>
        </MDBContainer>
      </MDBNavbar>
    </MDBContainer>
    );
  }
}

export default App;
